  let { results } = useParams();

  return (
    <>
        {searchValue !== null 
        ? searchValue.map( item => <TABox locationId={item.location_id}/>) : filterValue !== null ? filterValue.map( item => <TABox locationId={item.location_id}/>) : null}
    </>
  );
}

export default SearchResults;
